    "#Bind the table\n",
    "continents1 <- cbind(continents[1], stack(continents[c(2,3)]))\n",
    "\n",
    "#Rename columns\n",
    "continents1 <- continents1 %>% \n",
    "  rename(Count = values, Attribute = ind)\n",
    "\n",
    "#Reorder columns\n",
    "continents1 <- continents1[,c(1,3,2)]\n",
    "\n",
    "head(continents1)"
