   },
   "source": [
    "Now let us create empty plots that contain just the sum of the different attributes. They will give more details to the dashboard."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 15,
   "id": "a7fdca20",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2022-06-09T23:20:31.745986Z",
     "iopub.status.busy": "2022-06-09T23:20:31.744406Z",
     "iopub.status.idle": "2022-06-09T23:20:31.780367Z",
     "shell.execute_reply": "2022-06-09T23:20:31.778472Z"
    },
    "papermill": {
     "duration": 0.049599,
     "end_time": "2022-06-09T23:20:31.782469",
     "exception": false,
     "start_time": "2022-06-09T23:20:31.732870",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "#Create a blank theme (that permits border and color)\n",
    "theme <- theme(axis.text.y   = element_blank(),\n",
    "      axis.text.x   = element_blank(),\n",
    "      axis.title.y  = element_blank(),\n",
    "      axis.title.x  = element_blank(),\n",
    "      panel.background = element_blank(),\n",
    "      panel.grid.major = element_blank(), \n",
    "      panel.grid.minor = element_blank(),\n",
    ")\n",
    "\n",
    "#Population\n",
    "g5 <- ggplot() +\n",
    "  annotate(\"text\", x = 10,  y = 10,\n",
    "           size = 6,\n",
    "           label = sum(continents$Population)) + \n",
    "  labs(\n",
    "    title = \"World Population\",       # plot title\n",
    "  ) +\n",
    "  theme +\n",
    "  theme(plot.background = element_rect(colour = \"black\", fill=\"coral1\", size=1))\n",
    "\n",
    "#Total Cases\n",
    "g6 <- ggplot() +\n",
    "  annotate(\"text\", x = 10,  y = 10,\n",
    "           size = 6,\n",
    "           label = sum(continents$`Total Cases`)) + \n",
    "  labs(\n",
    "    title = \"Total Cases\",       # plot title\n",
    "  ) +\n",
    "  theme +\n",
    "  theme(plot.background = element_rect(colour = \"black\", fill=\"darkgoldenrod\", size=1))\n",
    "\n",
    "#Active Cases\n",
    "g7 <- ggplot() +\n",
    "  annotate(\"text\", x = 10,  y = 10,\n",
    "           size = 6,\n",
    "           label = sum(continents$`Active Cases`)) + \n",
    "  labs(\n",
    "    title = \"Active Cases\",       # plot title\n",
    "  ) +\n",
    "  theme +\n",
    "  theme(plot.background = element_rect(colour = \"black\", fill=\"chartreuse4\", size=1))\n",
    "\n",
    "#Deaths\n",
    "g8 <- ggplot() +\n",
    "  annotate(\"text\", x = 10,  y = 10,\n",
    "           size = 6,\n",
    "           label = sum(continents$Deaths)) + \n",
    "  labs(\n",
    "    title = \"Deaths\",       # plot title\n",
    "  ) +\n",
    "  theme +\n",
    "  theme(plot.background = element_rect(colour = \"black\", fill=\"deepskyblue\", size=1))"
   ]
  },
